import React from 'react';
import arrows from '../../images/background.svg';

const Background = () => {

    return(
        <div>
        <img 
        style={{
            backgroundImage: `url(${arrows})`, 
            backgroundPosition: 'center', 
            backgroundSize: 'cover', 
            backgroundRepeat: 'no-repeat',
            repeatStyle: "none"
        }}/>
        </div>
    )
};

export default Background;
